text:'{"blocks":[{"key":"9cjga","text":"È da tanto tempo che non ci sentiamo. Spero che tu stia bene!","type":"unstyled","depth":0,"inlineStyleRanges":[{"offset":0,"length":61,"style":"hlnk:"},{"offset":0,"length":61,"style":"hlnkt:wp"},{"offset":0,"length":61,"style":"textOutlineEnable:false"},{"offset":0,"length":61,"style":"opacity:1"},{"offset":0,"length":61,"style":"hlnke:true"},{"offset":0,"length":61,"style":"backgroundColor:unset"},{"offset":0,"length":61,"style":"defaultBackgroundColor:#E8D01B"},{"offset":0,"length":61,"style":"textHighlightEnable:false"},{"offset":0,"length":61,"style":"textShadowEnable:false"},{"offset":0,"length":61,"style":"overridden:false"}],"entityRanges":[],"data":{"listType":"S_Bullets08","listColor":"#666666","listIndent":"100%","listSize":"100%","listDepth":"0","overridden":"false","presetId":"text-body-2"}},{"key":"39g58","text":"Sai che quest’anno ho iniziato il liceo? Mamma mia! Ma quanto è difficile! Io ho già capito che la matematica non mi piace, preferisco decisamente letteratura. Sai che da sempre leggo molto, per questo motivo mi piacciono molto le lezioni di italiano dove possiamo scrivere i testi. ","type":"unstyled","depth":0,"inlineStyleRanges":[{"offset":0,"length":283,"style":"hlnk:"},{"offset":0,"length":283,"style":"hlnkt:wp"},{"offset":0,"length":283,"style":"textOutlineEnable:false"},{"offset":0,"length":283,"style":"opacity:1"},{"offset":0,"length":283,"style":"hlnke:true"},{"offset":0,"length":283,"style":"backgroundColor:unset"},{"offset":0,"length":283,"style":"defaultBackgroundColor:#E8D01B"},{"offset":0,"length":283,"style":"textHighlightEnable:false"},{"offset":0,"length":283,"style":"textShadowEnable:false"},{"offset":0,"length":283,"style":"overridden:false"}],"entityRanges":[],"data":{"listType":"S_Bullets08","listColor":"#666666","listIndent":"100%","listSize":"100%","listDepth":"0","overridden":"false","presetId":"text-body-2"}},{"key":"8mifj","text":"Devo dire che anche se la scuola non è facile, mi piace molto e ci vado volentieri anche perché lì ho conosciuto tanti nuovi amici. Loro sono proprio simpatici e a volte voglio arrivare a scuola prima così posso passare del tempo a chiacchierare con loro. ","type":"unstyled","depth":0,"inlineStyleRanges":[{"offset":0,"length":256,"style":"backgroundColor:unset"},{"offset":0,"length":256,"style":"defaultBackgroundColor:#E8D01B"},{"offset":0,"length":256,"style":"textHighlightEnable:false"},{"offset":0,"length":256,"style":"textShadowEnable:false"},{"offset":0,"length":256,"style":"overridden:false"},{"offset":0,"length":256,"style":"hlnk:"},{"offset":0,"length":256,"style":"hlnkt:wp"},{"offset":0,"length":256,"style":"textOutlineEnable:false"},{"offset":0,"length":256,"style":"opacity:1"},{"offset":0,"length":256,"style":"hlnke:true"}],"entityRanges":[],"data":{"listType":"S_Bullets08","listColor":"#666666","listIndent":"100%","listSize":"100%","listDepth":"0","overridden":"false","presetId":"text-body-2"}},{"key":"6fdrv","text":"","type":"unstyled","depth":0,"inlineStyleRanges":[],"entityRanges":[],"data":{"listType":"S_Bullets08","listColor":"#666666","listIndent":"100%","listSize":"100%","listDepth":"0","overridden":"false","presetId":"text-body-2"}}],"entityMap":{}}',
